import React from 'react';

import './css/footer.css';
const Footer = () => {
    return (
        <footer id="footer">
            <br />
            <ul>
                <li>&copy; 2020 by Gefy Aqiilah Aqshal</li>
            </ul>
        </footer>
    )
}
export default Footer;
